lspath (){
   for p in $* ; do
      TP=$(echo $p |sed 's/^\(.\).*$/\1/g')
      if [ "$TP" = "/" ] ; then
         echo $p
      else
         echo $(pwd -P)/$p
      fi
   done
}
make_source_from_htk (){
   local FP2TK=$(lspath $0)
   local HPSCD=hyperf_source_code
   if ! mkdir $HPSCD ; then
      echo Unable to make $HPSCD. Exiting...
      exit
   fi
   extract_source_items_and_set_sidir
   pushd $HPSCD &>$DN
   mkdir configs controller cqt grouper
   mv ${SIDIR}${MDIR}/lib/{freecans,demo_system} .
   local ESIZE="$(($(grep -n "^#BEGIN_YOLK_${MPLD}" $FP2TK | cut -d":" -f1)-2))"
   head -${ESIZE} $FP2TK | sed 's/^# htk.sh--.*$/# htk.sh/g' > controller/hyperf.sh
   mv freecans/HYPERF.{BASHRC.sh,PROJECT.template,VIMDIFF.vim} configs
   mv freecans/HYPERF.{ENVIRONMENT.README,INPUTRC.sh,VIMRC.vim} configs
   mv freecans/{dot.bashrc.sh,EXAMPLE.CYGWIN.BASHRC.sh,debug.vimrc} configs
   mv freecans/cqt.sh cqt
   mv freecans/grouper.sh grouper
   mv ${SIDIR}${MDIR}/lib/precans . 2>$DN
   mv ${SIDIR}${MDIR}/lib/funcs ./libs
   mv ${SIDIR}${DOCDIR} ./documentation
   mkdir jail_tools jic plush release sync license
   mv freecans/jail_tools*.tgz jail_tools
   mv freecans/jic.sh jic
   mv freecans/plush.profile plush
   ln -s freecans/htk_development_launcher_scriptlet ./.htk_development_launcher_scriptlet
   cp documentation/LICENSE license/hyperf.copyright.license
   safely_remove_extraction_directory $SIDIR
   popd &>$DN
   echo "                                              ------------------"
   echo "Source items should now be extracted here --> $(ls -d $HPSCD)"
   echo "                                              ------------------"
}
